ordinates":null,"group":null},"id":"5837","type":"Title"},{"attributes":{"tools":[{"id":"5689"},{"id":"5690"},{"id":"5691"}]},"id":"5692","type":"Toolbar"},{"attributes":{},"id":"5583","type":"CategoricalScale"},{"attributes":{"source":{"id":"5460"}},"id":"5493","type":"CDSView"},{"attributes":{"coordinates":null,"formatter":{"id":"5906"},"group":null,"major_label_policy":{"id":"5907"},"ticker":{"id":"5682"}},"id":"5681","type":"DatetimeAxis"},{"attributes":{"overlay":{"id":"5482"}},"id":"5479","type":"BoxZoomTool"},{"attributes":{},"id":"5917","type":"DatetimeTickFormatter"},{"attributes":{"dimensions":"width"},"id":"5565","type":"WheelZoomTool"},{"attributes":{},"id":"5549","type":"BasicTicker"},{"attributes":{"start":0},"id":"5675","type":"DataRange1d"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 35.17 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 511 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 4164.40 s &lt;/li&gt;\n&lt;li&gt; transfer time: 53.74 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.32.2.33:39977 &lt;/li&gt;\n          &lt;li&gt; Workers: 128 &lt;/li&gt;\n          &lt;li&gt; Threads: 128 &lt;/li&gt;\n          &lt;li&gt; Memory: 1.86 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.09.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.09.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n\nfrom dask_jobqueue import SLURMCluster\nfrom distributed import Client\n\nfrom dask.distributed import performance_report, get_task_stream\n\n#import logging\n#logging.basicConfig(format='%(levelname)s:%(message)s', level=logging.DEBUG)\n\ncores = 32\nnodes = 4\n\ncluster = SLURMCluster(memory          = '{}g'.format(16*cores),\n                       processes       = cores,\n                       name            = 'testdask-${JOB_ID}',\n                       cores           = cores,\n                       queue           = 'photon',\n                       local_directory = '/tmp',\n                       death_timeout   = '100000000000s',\n                       walltime        = '01:00:00',\n                       header_skip     = ['-n 1'], \n                       env_extra       = ['JOB_ID=${SLURM_ARRAY_JOB_ID}_${SLURM_ARRAY_TASK_ID}'],\n                       job_extra       = ['--ntasks-per-node=1', '--array=0-{}'.format(nodes-1), '--exclusive']) \n\ncluster.scale(jobs=1)\nclient = Client(cluster)\n\nclient.get_versions(check=True)\n\n\n#import pdb; pdb.set_trace() \nclient.upload_file('../../root/root_rdfenv-ucx-2/lib/DistRDF/Backends/Dask/Backend.py')\nclient.upload_file('../../root/root_rdfenv-ucx-2/lib/ROOT/__init__.py')\n\n\n\nimport ROOT\nROOT.gROOT.SetBatch(True)\nRDataFrame = ROOT.RDF.Experimental.Distributed.Dask.RDataFrame\n\n\n\ndef dimuonSpectrum(df):\n\n    # Select events with exactly two muons\n    df_2mu = df.Filter(\"nMuon == 2\", \"Events with exactly two muons\")\n\n    # Select events with two muons of opposite charge\n    df_os = df_2mu.Filter(\"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\"Dimuon_mass\", \"ROOT::VecOps::InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Book histogram of dimuon mass spectrum\n    bins = 30000  # Number of bins in the histogram\n    low = 0.25  # Lower edge of the histogram\n    up = 300.0  # Upper edge of the histogram\n    hist = df_mass.Histo1D(ROOT.RDF.TH1DModel(\"\", \"\", bins, low, up), \"Dimuon_mass\")\n\n    hist.GetValue() # triggers the event loop\n\n\nif __name__ == '__main__':\n    \n    filelist = [\"input_files/dimuon/f{}.root\".format(i) for i in range(1, 101)]\n    df = RDataFrame(\"Events\", filelist, npartitions=256, daskclient=client) \n   \n    #import pdb; pdb.set_trace()\n   \n    for r in range(3):\n        client.wait_for_workers(cores*nodes)\n        with performance_report(filename=\"dask-report_{}.html\".format(r)):\n            dimuonSpectrum(df)\n    client.close()\n\n        &lt;/pre&gt;\n        "},"id":"5823","type":"Div"},{"attributes":{"factors":["a","b"]},"id":"5577","type":"FactorRange"},{"attributes":{"bottom":{"field":"bottom"},"fill_alpha":{"value":0.2},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_alpha":{"value":0.2},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"5491","type":"Quad"},{"attributes":{"tools":[{"id":"5808"},{"id":"5809"},{"id":"5810"}]},"id":"5811","type":"Toolbar"},{"attributes":{},"id":"5475","type":"BasicTicker"},{"attributes":{},"id":"5947","type":"Selection"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth by Worker"},"id":"5575","type":"Title"},{"attributes":{"axis":{"id":"5474"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"id":"5477","type":"Grid"},{"attributes":{"dimensions":"width"},"id":"5564","type":"PanTool"},{"attributes":{},"id":"5869","type":"CategoricalTickFormatter"},{"attributes":{"dimensions":"width"},"id":"5690","type":"PanTool"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"5948"},{"id":"5949"},{"id":"5950"},{"id":"5951"},{"id":"5952"},{"id":"5953"},{"id":"5954"},{"id":"5955"},{"id":"5956"},{"id":"5957"},{"id":"5958"},{"id":"5959"}]},"id":"5682","type":"DatetimeTicker"},{"attributes":{"below":[{"id":"5585"}],"center":[{"id":"5587"},{"id":"5590"}],"left":[{"id":"5
